(lib._pageScroll_mc_vertical = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		var self = this;
		createjs.Touch.enable(stage);
		
		var firstSwipe = true;
		var mc_drag = self.mc_drag;
		var drag_y = mc_drag.y;
		var drag_h = Math.round(mc_drag.getBounds().height);
		//var masker_h = 485; //<============== yang sering diganti
		var masker_h = ((self.mc_drag.getBounds().height) / 2) + (self.mc_drag.getBounds().height * 0.1);
		var maxDrag_y = drag_y - (drag_h - masker_h);
		var mc_slider = self.mc_slider;
		var sliderBg_y = self.mc_slider_bg.y;
		var slider_h = Math.round(self.mc_slider.getBounds().height);
		var sliderBgr_h = Math.round(self.mc_slider_bg.getBounds().height);
		var sliderDis = (sliderBgr_h - slider_h) + sliderBg_y;
		var minY = maxDrag_y;
		var maxY = mc_drag.y;
		var barMinY = self.mc_slider.y;
		var barMaxY = sliderDis;
		var bDone = false;
		//console.log(Math.round(sliderDis));
		mousePosY = 0;
		
		mc_drag.addEventListener("mousedown", evtMouseDown);
		mc_drag.addEventListener("pressmove", evtMouseMove);
		mc_drag.addEventListener("pressup", evtMouseUp);
		function evtMouseDown(evt) {
			drag_y = mc_drag.y;
			var p = self.globalToLocal(evt.stageX, evt.stageY);
			mousePosY = p.y;
		};
		function evtMouseMove(evt) {
			var p = self.globalToLocal(evt.stageX, evt.stageY);
			var deltaPos_y = p.y - mousePosY;
			//mc_drag.x = p.x;
			mc_drag.y = drag_y + deltaPos_y;
		
			var perc = 0;
			var moveLength = 0;
			var moveDragDist = 0;
			moveLength = Math.abs(maxY - minY);
			moveDragDist = (maxY - mc_drag.y);
			perc = moveDragDist / moveLength;
			if (perc < 0)
				perc = 0;
			//console.log("perc " + perc)
			//TODO:
			if (mc_slider) {
				mc_slider.y = barMinY + (perc * (barMaxY - barMinY));
				mc_slider.y = Math.min(mc_slider.y, barMaxY);
			}
		};
		function evtMouseUp(evt) {
			//console.log("mouseUP");
			if (mc_drag.y < minY) {
				//mc_drag.y = minY;
				if (!bDone) {
					console.log("scroll complete");
					bDone = true;
				}
				TweenLite.to(mc_drag, 0.25, {
					y: minY,
					ease: Back.easeOut
				});
			} else if (mc_drag.y > maxY) {
				//mc_drag.y = maxY;
				TweenLite.to(mc_drag, 0.25, {
					y: maxY,
					ease: Back.easeOut
				});
			}
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// mc_slider
	this.mc_slider = new lib.mc_help_scrub();
	this.mc_slider.name = "mc_slider";
	this.mc_slider.parent = this;
	this.mc_slider.setTransform(1083.2,204.7);

	this.mc_slider_bg = new lib.mc_help_bar();
	this.mc_slider_bg.name = "mc_slider_bg";
	this.mc_slider_bg.parent = this;
	this.mc_slider_bg.setTransform(1086.3,206.85,1,1.0022);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.mc_slider_bg},{t:this.mc_slider}]}).wait(1));

	// bmp_textbox3 (mask)
	var mask = new cjs.Shape();
	mask._off = true;
	mask.graphics.p("Ap53jMBf5AAAMAAABGtMhf5AAAg");
	mask.setTransform(550.3699,301.7848);

	// mc_drag
	this.mc_drag = new lib.mc_drag();
	this.mc_drag.name = "mc_drag";
	this.mc_drag.parent = this;

	var maskedShapeInstanceList = [this.mc_drag];

	for(var shapedInstanceItr = 0; shapedInstanceItr < maskedShapeInstanceList.length; shapedInstanceItr++) {
		maskedShapeInstanceList[shapedInstanceItr].mask = mask;
	}

	this.timeline.addTween(cjs.Tween.get(this.mc_drag).wait(1));

}).prototype = getMCSymbolPrototype(lib._pageScroll_mc_vertical, new cjs.Rectangle(487,151,603.4000000000001,452.6), null);


